Here is a step-by-step guide to creating a React,Node, and Express.js web app for creating, adding dummy data, and showing it. We will also cover how to deploy the code after creating a build.

**Step 1: Create a new React app**

Open your terminal and run the following command to create a new React app:
```
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node and Express.js server**

In the `my-app` directory, create a new file called `server.js`. This file will contain the code for our Node and Express.js server.

Add the following code to `server.js`:
```
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let data = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
  { id: 3, name: 'Bob Smith', age: 40 },
];

app.get('/api/data', (req, res) => {
  res.json(data);
});

app.post('/api/data', (req, res) => {
  const newData = req.body;
  data.push(newData);
  res.json(data);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code creates an Express.js server that listens on port 3001. It also defines two API endpoints: one for getting data and one for adding new data.

**Step 3: Create a React component to display the data**

In the `my-app` directory, create a new file called `DataComponent.js`. This file will contain the code for our React component that displays the data.

Add the following code to `DataComponent.js`:
```
import React, { useState, useEffect } from 'react';

function DataComponent() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      <h1>Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            {item.name} ({item.age})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DataComponent;
```
This code defines a React component that fetches the data from the `/api/data` endpoint and displays it in an unordered list.

**Step 4: Add the React component to the app**

Open the `App.js` file and add the following code:
```
import React from 'react';
import DataComponent from './DataComponent';

function App() {
  return (
    <div>
      <DataComponent />
    </div>
  );
}

export default App;
```
This code adds the `DataComponent` to the app.

**Step 5: Start the server and the app**

Start the server by running the following command in the terminal:
```
node server.js
```
Start the app by running the following command in the terminal:
```
npm start
```
This will start the app in development mode.

