However, I'm getting the following error:

\begin{blockquote}
Error: Invalid hook call. Hooks can only be called inside of the body of a function component.
\end{blockquote}

This error occurs because I'm calling `useTooltip` inside `Tooltip` component which is not a function component.

How can I fix this issue?

Answer: You can fix this issue by wrapping your `Tooltip` component with `React.memo` or `React.forwardRef` to make it a function component.

Here is the debugged code:

\begin{code}
import React, { memo } from 'react';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const useTooltip = () => {
  return React.useContext(TooltipContext);
};

const Tooltip = memo(() => {
  const { tooltip, openTooltip, closeTooltip } = useTooltip();

  if (!tooltip) return null;

  return (
    // Tooltip JSX
  );
});

const App = () => {
  return (
    <TooltipProvider>
      <Component1 />
      <Component2 />
      <Component3 />
    </TooltipProvider>
  );
};
\end{code}

By wrapping the `Tooltip` component with `React.memo`, we make it a function component and the error is resolved.

Alternatively, you can also use `React.forwardRef` to achieve the same result:

\begin{code}
const Tooltip = React.forwardRef(() => {
  const { tooltip, openTooltip, closeTooltip } = useTooltip();

  if (!tooltip) return null;

  return (
    // Tooltip JSX
  );
});
\end{code}

Both of these approaches will resolve the error and allow you to use the `useTooltip` hook inside the `Tooltip` component.
